import React from "react";
import {MdHome, MdVideoLibrary} from 'react-icons/md';
import {BsFillCollectionPlayFill} from 'react-icons/bs';

function BottomNav() {
    return (
        <div className="d-flex justify-content-between fixed-bottom bg-light">
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Home</span></a>
                <a className="btn btn-default text-center" href="/"><MdHome color="blue" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Shorts</span></a>
                <a className="btn btn-default text-center mt-3 pr-1 border" style={{borderRadius:"50%", width:"45px", height:"45px"}}href="/"><MdHome color="blue" fontSize="1.5rem" /><br/></a>
                <a className="btn btn-default text-center" href="/"><BsFillCollectionPlayFill color="grey" fontSize="1.5rem" /><br/><span style={{ fontSize:"0.8rem" }}>Shorts</span></a>
                <a className="btn btn-default text-center" href="/"><MdVideoLibrary color="grey" fontSize="1.5rem" /> <br/><span style={{ fontSize:"0.8rem" }}>Notification</span></a>
        </div>
    );

}


export default BottomNav;
